let savedDpi1;
const vLedNames = ["Logo", "Scroll Zone", "Front Zone", "Dpi Zone Low", "Dpi Zone Mid", "Dpi Zone High"];

const vLedPositions = [
	[3, 2], [3, 1], [3, 0], [0, 1], [1, 1], [2, 1]
];

export function LedNames() {
	return vLedNames;
}

export function LedPositions() {
	return vLedPositions;
}


function sendPacketString(string, size){
	const packet= [];
	const data = string.split(' ');

	for(let i = 0; i < data.length; i++){
		packet[parseInt(i, 16)] = parseInt(data[i], 16);//.toString(16)
	}

	device.write(packet, size);
}

export function Initialize() {


	sendPacketString("00 09 01 03 00 02", 65);//software control packet
	sendPacketString("00 09 0D 00 01", 65); // open endpoint
	//sendPacketString("00 09 0D 00 02",65) // open endpoint


	if(DpiControl) {
		setDpi(dpi1);
	}
}

function sendColors(shutdown = false){

	let packet = [];
	packet[0x00]   = 0x00;
	packet[0x01]   = 0x09;
	packet[0x02]   = 0x06;
	packet[0x03]   = 0x00;
	packet[0x04]   = 0x12;
	packet[0x05]   = 0x00;
	packet[0x06]   = 0x00;
	packet[0x07]   = 0x00;

	const red = [];
	const green = [];
	const blue = [];


	for(let zone_idx = 0; zone_idx < vLedPositions.length; zone_idx++) {
		const iX = vLedPositions[zone_idx][0];
		const iY = vLedPositions[zone_idx][1];
		var col;

		if(shutdown){
			col = hexToRgb(shutdownColor);
		}else if (LightingMode === "Forced") {
			col = hexToRgb(forcedColor);
		}else{
			col = device.color(iX, iY);
		}

		red[zone_idx] = col[0];
		green[zone_idx] = col[1];
		blue[zone_idx] = col[2];
	}

	packet = packet.concat(red);
	packet = packet.concat(green);
	packet = packet.concat(blue);
	device.write(packet, 65);
}
export function Render() {


	sendColors();

	if(savedDpi1 != dpi1 && DpiControl){
		setDpi(dpi1);
	}

	device.pause(1);
}

function setDpi(dpi){

	savedDpi1 = dpi;

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x09;
	packet[2] = 0x01;
	packet[3] = 0x21;
	packet[4] = 0x00;
	packet[5] = dpi%256;
	packet[6] = Math.floor(dpi/256);
	device.write(packet, 65);
	device.pause(2);

	var packet = [];
	packet[0] = 0x00;
	packet[1] = 0x09;
	packet[2] = 0x01;
	packet[3] = 0x22;
	packet[4] = 0x00;
	packet[5] = dpi%256;
	packet[6] = Math.floor(dpi/256);
	device.write(packet, 65);
}

function hexToRgb(hex) {
	const result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
	const colors = [];
	colors[0] = parseInt(result[1], 16);
	colors[1] = parseInt(result[2], 16);
	colors[2] = parseInt(result[3], 16);

	return colors;
}
export function Validate(endpoint) {
	return endpoint.interface === 1;
}

